import React from 'react';
import './Courses.css';

function Courses() {
  const courses = [
    { id: 1, name: 'Web Development', image: '/images/course1.jpeg' },
    { id: 2, name: 'Data Science', image: '/images/course2.jpg' },
    { id: 3, name: 'AI and ML', image: '/images/course3.jpg' },
  ];

  return (
    <div className="courses">
      <h2>Courses Offered</h2>
      <div className="courses-list">
        {courses.map((course) => (
          <div key={course.id} className="course-card">
            <img src={course.image} alt={course.name} />
            <p>{course.name}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Courses;
